import React from 'react';

class Thankyou extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: '',
        }
    }

    render() {
        return (
            <div className="cat">
                <label className="db pv6 fw6 lh-copy f1" htmlFor="name">シェアハピありがとうございます！！</label>
                <input
                    className="b ph3 pv2 input-reset b--white bg-white grow pointer f4 dib"
                    type="submit"
                    value="ホームに戻る"
                    onClick={this.props.onRouteChange}
                />
            </div>
        );
    }
}


export default Thankyou;
